import React, { Component } from 'react'
import './DetailPokemon.css';
import '../../App.css';
import { Card } from '@material-ui/core';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import Grow from '@material-ui/core/Grow';

/**
* @author
* @function DetailPokemon
**/

class DetailPokemon extends Component{

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      pokemon: [],
      grow: false,

    };
  }

    componentDidMount() {
      console.log(this.props)
      fetch(this.props.url)
        .then(res => res.json())
        .then((result) => {
          this.setState({ 
            pokemon: result, 
            grow:true})
        })
        .catch(console.log)
      }



      render() {
        const {pokemon}=this.state
        console.log(pokemon)
        return(
          <Card className='card'>
            <Card className='pokedex-pokemon-profile'>
            <GridList cols={4} cellHeight={180} className='gridList'>
              <GridListTile cols={2} style={{ height: 'auto' }}>
              </GridListTile>
            <Grow in={this.state.grow}>
              <GridListTile className='gridTile' key={pokemon.id} >
              <img src="" alt={pokemon.name} />
              </GridListTile>
              <GridListTile className='gridTile' key={pokemon.id} >
              <img src="" alt={pokemon.name} />
              </GridListTile>
            </Grow>
            </GridList>
            </Card>
          </Card>
        )
      }
 }

export default DetailPokemon;
